import { createBrowserRouter, createRoutesFromElements, RouterProvider, Route, Routes } from 'react-router-dom';
import EditJobPage from './pages/EditJob';
import ErrorPage from './pages/Error';
import JobDetailPage from './pages/JobDetail';
import JobsPage from './pages/Jobs';
import JobsRootLayout from './pages/JobsRoot';
import HomePage from './pages/Home';
import NewJobPage from './pages/NewJob';
import RootLayout from './pages/Root';
import { action as manipulateJobAction } from './components/JobForm';

const router = createBrowserRouter(
    createRoutesFromElements(
        <Routes>
            <Route path = "/" exact  errorElement = {<ErrorPage />} component = {<RootLayout />}>
                <Route index component = {<HomePage />}></Route>
                <Route path = "/jobs" component = {<JobsRootLayout />}></Route>
                <Route index component = {<JobsPage />}></Route>
                <Route path = "/jobs/:id"></Route>
                <Route index component = {<JobDetailPage />}></Route>
                <Route path = "/jobs/:id/edit" action = {manipulateJobAction} component = {<EditJobPage />}></Route>
                <Route path = "/jobs/new" action = {manipulateJobAction} component = {<NewJobPage />}></Route>
            </Route>
        </Routes>
    )
);

